import Item1 from './item1-components';
import Item2 from './item2-components';
import Item3 from './item3-components';

function App() {
  return (
    <div className="App">
		<div class='container-fluid'>
			<div class='row'>

				{/* left column starts here */}
				<div class='col-md-3'>

					<Quick />

				</div>
				{/* left column ends here */}

				{/* right column starts here */}	
				<div class='col-md-9' style={{backgroundColor: '#e6e5e3',marginLeft: '-7vw'}}>
					<div class='row'>
						<div class='col-md-3'>
							<Item1 name='Ladies Hand Bag Proper Leather' />
						</div>
						<div class='col-md-3'>
							<Item2 name='Ladies Hand Bag Diamond'/>
						</div>
						<div class='col-md-3'>
							<Item3 name='Ladies Tom Bag'/>
						</div>
						<div class='col-md-3'>
							<Item1 name='Ladies Hand Bag Proper Leather'/>
						</div>
					</div>


				{/* right column ends here */}

				</div>
			</div>

		</div>
    </div>
  );
}

export default App;
